    edges = []
    for sample_differences in samples_differences:
        for i in range(k):
            for j in range(i + 1, k):
                if sample_differences[i] > sample_differences[j]:
                    edge = (i, j)
                    edges.append(edge)

    # compute the minimal unlikeliness
