    N, M = map(int, stdin.split())

    # Create the graph
    intersections = {}
    streets = {}
    for _ in range(N):
        intersections[int(stdin.readline().split()[1])] = [
            int(x) for x in stdin.readline().split()[1:]
        ]
        streets[int(stdin.readline().split()[1])] = [
            (int(x), int(x)) for x in stdin.readline().split()[1:]
        ]

    # Find the path
    path = []
    for _ in range(M):
        A, B, L = map(int, stdin.readline().split())
        if A not in intersections:
            print("No")
            return
        if B not in intersections:
            print("No")
            return
        if A in intersections[B]:
            print("No")
            return

        path.append((A, B, L))

    path = sorted(path, key=lambda tup: tup[2])

    if path[0][0]!= path[-1][1]:
        print("No")
        return

    start = path[0][0]
    end = path[0][1]

    distance = 0
    streets_traveled = {}
    current_street = None
    streets_traveled[start] = 0

    for i, (a, b, l) in enumerate(path):
        if i == 0:
            continue

        # Calculate the distance travelled
        distance += abs(a - b)
        if distance > l:
            # Stop
            if current_street is None:
                continue
            else:
                distance -= abs(current_street[0] - current_street[1])
                if current_street not in intersections[current_street[1]]:
                    continue

                # Add to the intersection with the shortest time
                if current_street[1] not in streets_traveled or (
                        current_street[0] - current_street[1]
                        < streets_traveled[current_street[1]]
                        and current_street[0] - current_street[1]!= 0):
                    streets_traveled[current_street[1]] = current_street[0] - current_street[1]

                current_street = None

        # Travel to the new intersection
        if a not in streets_traveled:
            streets_traveled[a] = 0
        if b not in streets_traveled:
            streets_traveled[b] = 0
        current_street = (a, b)

    # Add the distance between the last and first intersection
    distance += abs(start - end)
    if current_street is None:
        continue
    else:
        if current_street not in streets_traveled:
            streets_traveled[current_street[0]] = 0
        if current_street[0] not in streets_traveled:
            streets_traveled[current_street[1]] = 0

    # Find the intersection with the shortest time
    result = min(streets_traveled.items(), key=operator.itemgetter(1))

    # Add the distance between the last and first intersection
    distance += abs(result[0] - result[1])
    if result[0] not in streets_traveled:
        streets_traveled[result[0]] = 0
    if result[1] not in streets_traveled:
        streets_traveled[result[1]] = 0

    # Output
    print(distance)
    return ""

